import React from "react";
import {useNavigate} from "react-router-dom";

const Header=()=> {
    const nav = useNavigate()
  return (
    <header class="text-gray-600 body-font">
    <div class="container mx-auto flex flex-wrap p-5 flex-col md:flex-row items-center">
      <div class="flex title-font font-medium items-center text-gray-900 mb-4 md:mb-0">

        <span class="ml-3 text-xxl">Ashutosh Singh</span>
      </div>
      <nav class="md:ml-auto md:mr-auto flex flex-wrap items-center text-base justify-center">
        <a class="mr-5 hover:text-gray-900" onClick={()=>{nav("/Home")}}>Home</a>
        <a class="mr-5 hover:text-gray-900" onClick={()=>{nav("/About")}} href="Home">About</a>
        <a class="mr-5 hover:text-gray-900" onClick={()=>{nav("/Project")}} href="Home">Project</a>
        <a class="mr-5 hover:text-gray-900" href="Home">Blog</a>
      </nav>
    </div>
  </header>
  );
}

export default Header;
